selector_to_html = {"a[href=\"#id11\"]": "<figure class=\"align-center\" id=\"id11\">\n<a class=\"reference internal image-reference\" href=\"../../media/25AutoSav23On.png\"><img alt=\"../../media/25AutoSav23On.png\" src=\"../../media/25AutoSav23On.png\" style=\"width: 300px;\"/>\n</a>\n<figcaption>\n<p><span class=\"caption-text\">Abilita Modalit\u00e0 Di Archiviazione Automatica</span><a class=\"headerlink\" href=\"#id11\" title=\"Link to this image\">#</a></p>\n</figcaption>\n</figure>", "a[href=\"#id10\"]": "<figure class=\"align-center\" id=\"id10\">\n<a class=\"reference internal image-reference\" href=\"../../media/25AutoSav23Off.png\"><img alt=\"../../media/25AutoSav23Off.png\" src=\"../../media/25AutoSav23Off.png\" style=\"width: 300px;\"/>\n</a>\n<figcaption>\n<p><span class=\"caption-text\">Disabilita Modalit\u00e0 Di Archiviazione Automatica</span><a class=\"headerlink\" href=\"#id10\" title=\"Link to this image\">#</a></p>\n</figcaption>\n</figure>", "a[href=\"#clear-stored-barcode\"]": "<h3 class=\"tippy-header\" style=\"margin-top: 0;\">Cancella Codice A Barre Conservato<a class=\"headerlink\" href=\"#clear-stored-barcode\" title=\"Link to this heading\">#</a></h3>", "a[href=\"#data-upload1\"]": "<h3 class=\"tippy-header\" style=\"margin-top: 0;\">Caricamento Dati<a class=\"footnote-reference brackets\" href=\"#id2\" id=\"id1\" role=\"doc-noteref\"><span class=\"fn-bracket\">[</span>1<span class=\"fn-bracket\">]</span></a><a class=\"headerlink\" href=\"#data-upload1\" title=\"Link to this heading\">#</a></h3>", "a[href=\"#enable-automatic-storage-mode2\"]": "<h3 class=\"tippy-header\" style=\"margin-top: 0;\">Abilita La Modalit\u00e0 Di Stoccaggio Automatico<a class=\"footnote-reference brackets\" href=\"#id4\" id=\"id1\" role=\"doc-noteref\"><span class=\"fn-bracket\">[</span>2<span class=\"fn-bracket\">]</span></a><a class=\"headerlink\" href=\"#enable-automatic-storage-mode2\" title=\"Link to this heading\">#</a></h3>", "a[href=\"#disable-automatic-storage-mode\"]": "<h3 class=\"tippy-header\" style=\"margin-top: 0;\">Disabilita Modalit\u00e0 Di Archiviazione Automatica<a class=\"headerlink\" href=\"#disable-automatic-storage-mode\" title=\"Link to this heading\">#</a></h3>", "a[href=\"#id7\"]": "<figure class=\"align-center\" id=\"id7\">\n<a class=\"reference internal image-reference\" href=\"../../media/2523TXMEM.png\"><img alt=\"../../media/2523TXMEM.png\" src=\"../../media/2523TXMEM.png\" style=\"width: 300px;\"/>\n</a>\n<figcaption>\n<p><span class=\"caption-text\">Caricamento Dati</span><a class=\"headerlink\" href=\"#id7\" title=\"Link to this image\">#</a></p>\n</figcaption>\n</figure>", "a[href=\"#normal-mode\"]": "<h2 class=\"tippy-header\" style=\"margin-top: 0;\">Modalit\u00e0 Normale<a class=\"headerlink\" href=\"#normal-mode\" title=\"Link to this heading\">#</a></h2>", "a[href=\"#total-storage-quantity\"]": "<h3 class=\"tippy-header\" style=\"margin-top: 0;\">Quantit\u00e0 Totale Stoccaggio<a class=\"headerlink\" href=\"#total-storage-quantity\" title=\"Link to this heading\">#</a></h3>", "a[href=\"#id8\"]": "<figure class=\"align-center\" id=\"id8\">\n<a class=\"reference internal image-reference\" href=\"../../media/25232BTCNT.png\"><img alt=\"../../media/25232BTCNT.png\" src=\"../../media/25232BTCNT.png\" style=\"width: 300px;\"/>\n</a>\n<figcaption>\n<p><span class=\"caption-text\">Quantit\u00e0 Totale Stoccaggio</span><a class=\"headerlink\" href=\"#id8\" title=\"Link to this image\">#</a></p>\n</figcaption>\n</figure>", "a[href=\"#id4\"]": "<aside class=\"footnote brackets\" id=\"id4\" role=\"doc-footnote\">\n<span class=\"label\"><span class=\"fn-bracket\">[</span><a href=\"#id3\" role=\"doc-backlink\">2</a><span class=\"fn-bracket\">]</span></span>\n<p>In modalit\u00e0 di trasmissione wireless, quando la modalit\u00e0 di archiviazione automatica \u00e8 attivata, il codice a barre verr\u00e0 memorizzato automaticamente quando la trasmissione fallisce, e i dati memorizzati possono essere ottenuti tramite \u00abData Upload\u00bb.</p>\n</aside>", "a[href=\"#id6\"]": "<figure class=\"align-center\" id=\"id6\">\n<a class=\"reference internal image-reference\" href=\"../../media/2523INVMD.png\"><img alt=\"../../media/2523INVMD.png\" src=\"../../media/2523INVMD.png\" style=\"width: 300px;\"/>\n</a>\n<figcaption>\n<p><span class=\"caption-text\">Modalit\u00e0 Di Archiviazione</span><a class=\"headerlink\" href=\"#id6\" title=\"Link to this image\">#</a></p>\n</figcaption>\n</figure>", "a[href=\"#id9\"]": "<figure class=\"align-center\" id=\"id9\">\n<a class=\"reference internal image-reference\" href=\"../../media/25232ANEW2A.png\"><img alt=\"../../media/25232ANEW2A.png\" src=\"../../media/25232ANEW2A.png\" style=\"width: 300px;\"/>\n</a>\n<figcaption>\n<p><span class=\"caption-text\">Cancella Codice A Barre Conservato</span><a class=\"headerlink\" href=\"#id9\" title=\"Link to this image\">#</a></p>\n</figcaption>\n</figure>", "a[href=\"#storage-mode\"]": "<h2 class=\"tippy-header\" style=\"margin-top: 0;\">Modalit\u00e0 Di Archiviazione<a class=\"headerlink\" href=\"#storage-mode\" title=\"Link to this heading\">#</a></h2><h3>Caricamento Dati<a class=\"footnote-reference brackets\" href=\"#id2\" id=\"id1\" role=\"doc-noteref\"><span class=\"fn-bracket\">[</span>1<span class=\"fn-bracket\">]</span></a><a class=\"headerlink\" href=\"#data-upload1\" title=\"Link to this heading\">#</a></h3>", "a[href=\"#id2\"]": "<aside class=\"footnote brackets\" id=\"id2\" role=\"doc-footnote\">\n<span class=\"label\"><span class=\"fn-bracket\">[</span><a href=\"#id1\" role=\"doc-backlink\">1</a><span class=\"fn-bracket\">]</span></span>\n<p>Durante il caricamento dei dati, la scansione del comando \u00abData Upload\u00bb di nuovo annuller\u00e0 / fermer\u00e0 il caricamento dei dati.</p>\n</aside>", "a[href=\"#id5\"]": "<figure class=\"align-center\" id=\"id5\">\n<a class=\"reference internal image-reference\" href=\"../../media/2523NORMD.png\"><img alt=\"../../media/2523NORMD.png\" src=\"../../media/2523NORMD.png\" style=\"width: 300px;\"/>\n</a>\n<figcaption>\n<p><span class=\"caption-text\"><code class=\"docutils literal notranslate\"><span class=\"pre\">*</span></code> Modalit\u00e0 Normale</span><a class=\"headerlink\" href=\"#id5\" title=\"Link to this image\">#</a></p>\n</figcaption>\n</figure>", "a[href=\"#working-mode\"]": "<h1 class=\"tippy-header\" style=\"margin-top: 0;\">Modalit\u00e0 Di Lavoro<a class=\"headerlink\" href=\"#working-mode\" title=\"Link to this heading\">#</a></h1><p>Nella zona di lavoro al di fuori della gamma di 2. Ricevitore G o segnale Bluetooth, \u00e8 possibile attivare la modalit\u00e0 di archiviazione dello scanner seguendo i passaggi descritti di seguito. In questa modalit\u00e0, tutti i dati scansionati saranno memorizzati direttamente nello scanner. Prima di caricare i dati, verr\u00e0 salvato in modo permanente nello scanner in modo da poter caricare i dati quando lo scanner \u00e8 nell\u2019intervallo di segnale di ricezione.</p>"}
skip_classes = ["headerlink", "sd-stretched-link", "sd-rounded-pill"]

window.onload = function () {
    for (const [select, tip_html] of Object.entries(selector_to_html)) {
        const links = document.querySelectorAll(`article.bd-article ${select}`);
        for (const link of links) {
            if (skip_classes.some(c => link.classList.contains(c))) {
                continue;
            }

            tippy(link, {
                content: tip_html,
                allowHTML: true,
                arrow: true,
                placement: 'auto-start', maxWidth: 500, interactive: false,

            });
        };
    };
    console.log("tippy tips loaded!");
};
